package main

import (
    "fmt"
	"net"
	"strconv"
	"sync"
	"strings"
)

func main() {
	// mimic command line parameters
	workers := 10     // how many concurrent tasks
	intAdrr := "10.2.3.4"  // example ip
	start, end := 23, 480   // displays ports from 23 to 480 (start and end inclusive)

	var wg sync.WaitGroup
	jobs := make(chan int, workers*20) // used to distribute jobs

	for i :=0; i<workers; i++ { //spawn off the workers
		wg.Add(1)
		go worker(&wg, jobs)
	}

	for port :=start; port<=end; port++ { //send jobs to workers
  	    jobs <- port           	
    }
   	close(jobs) 

	str := intAdrr + ":"    
	wg.Wait()              // wait for workers
	fmt.Println("Scanning complete")
}

func worker(wg *sync.WaitGroup, jobs <- chan int) {
	for ports := range jobs {
		remote := strings.Join([]string{str, strconv.Itoa(ports)}, "")
		fmt.Println("trying >>>", remote)
		conn, _  error := net.Dial("tcp",remote)
		if err != nil {
			continue // port closed
		} 
		fmt.Println("[+] Port '", remote ,"' : Open")
		if conn != nil {conn.Close () // close connection noticed as open }
	}
	wg.Done()

}

